import { FunctionComponent } from 'react';
import { Button } from 'semantic-ui-react';
import { ETipoMensagem } from '../Enuns/ETipoMensagem';
import { Master } from './Master';
import Mensagem from './Mensagem/Mensagem';

function BtnAlerta ()
{ 
  <Mensagem Mensagem={"Mensagem de Aviso"} TipoMensagem={ETipoMensagem.Aviso}/>
}
function BtnErro ()
{
  <Mensagem Mensagem={"Mensagem de Aviso"} TipoMensagem={ETipoMensagem.Aviso}/>
}
function BtnDone ()
{
  <Mensagem Mensagem={"Mensagem de Aviso"} TipoMensagem={ETipoMensagem.Aviso}/>
}
function BtnConfirm()
{
  <Mensagem Mensagem={"Mensagem de Confirmação"} TipoMensagem={ETipoMensagem.Aviso}/>
}

export const Home: FunctionComponent = () => {
  return (
    <Master>    
      <button onClick={BtnAlerta}>Alerta</button>
      <button onClick={BtnErro}>Erro</button>
      <button onClick={BtnDone}>Done</button>
      <button onClick={BtnConfirm}>Confirmação</button> 
    </Master>
  );
};
